// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

contract IdentityWallet is Ownable{

// map idOwner address to a unique user id
// mapping (address => uint) private idOwner;
// mapping (address => mapping(address => did)) public didnum;

// address public owner;
//define struct for the user data
  struct BasicProfile{
    address owner;
    string fname;
    //string lname;
    uint age;
    //string homeAddress;
    uint phone;
    //string email;
  }

//define an array of users
  BasicProfile public basicProfile;

  // mapping syntax mapping (keyType => valueType) public mapName
  // if user has an entry set mapping to true
  mapping (address => bool) public userPresent;
  mapping (address => BasicProfile) public userProfile;


// define enums for request type - create, update, reset
  enum Request {
        Update,
        Read
    }

 modifier validUser () {
   //ensure user has a valid profile
    require(msg.sender != address(0), "Invalid User");
    _;
  }

  /////////////////////////////////
  ////// SAMPLE CODE FOR TESTING FROM SIMPLE STORAGE
  ////////////////////////////////
  uint storedData;

  function set(uint x) public {
    storedData = x;
  }

  function get() public view returns (uint) {
    return storedData;
  }

  // fallback() external {
  //     emit Log ("Something went wrong");
  // }
  event Log(string msg);

//constructor init values 
//   constructor() public {
// nothing at the moment
  // userProfile[msg.sender] = address[0];
//   }

  function adminTasks() public onlyOwner {
    //some potential tasks for admin
    // 1. transfer ownership
    // 2. renounce ownership
  }
// event log and emit when user data successfully updated

 // function to update user data [received from browser form]
//   function updateProfile(Request _requestType, uint _age, uint _phone, string memory _name) payable public{
  function updateProfile(uint _age, uint _phone, string memory _name) payable public validUser() {

    // require(if this role has admin then allow this function to execute)
    // valid user asking for a update
    // require(_requestType == Request.Update);

    if (userProfile[msg.sender].owner == address(0))
    {
      userProfile[msg.sender].owner = msg.sender;
    }

    if (userProfile[msg.sender].owner == msg.sender) 
        {
        // make sure msg.sender has a profile with us, if not check if profile to be created ?
        userProfile[msg.sender].fname = _name;
        userProfile[msg.sender].age = _age;
        userProfile[msg.sender].phone = _phone;

        emit Log("Updated Profile");
        }
    else
        {
        emit Log("Not authorised to update profile");
        }
    }

// function to retrieve user data. 
// coding best practice: not receommended to return an array from a function.. Cos it can get called 
// repeatedly and cost gas.
  function readProfile() external validUser() returns(string memory _name, uint _age, uint _phone){

        if (userProfile[msg.sender].owner == msg.sender) {
            _name = userProfile[msg.sender].fname;
            _age = userProfile[msg.sender].age;
            _phone = userProfile[msg.sender].phone;
            return (_name, _age, _phone);
         }
        else
        {
            emit Log("Not authorised to read profile");
        }
  }

}
